import React, {useState} from 'react'

function Home() {
    const [game, setGame] = useState({});

    const endpoint = "https://partners.9ijakids.com/index.php?partnerId=555776&accessToken=l0lawtvv-94bv-oi4d-u808-5ubz&action=catalogfilter";
    fetch(endpoint)
    .then(data => data.json)
    return (
        <div>
            <h2>9ijakids Game List</h2>
            <input type="search"/>
        </div>
    )
}

export default Home
